import React, { Component } from "react";
import "./BlogPost.css";

class BlogPost extends Component {
  render() {
    return (
      <div className="post-artikel">
        <h2>Daftar Artikel</h2>
        <div className="artikel"></div>
        <div className="gamber-artikel">
          <img src="http://placeimg.com/1200/1200/tech" alt="Gambar Tumbnail Artikel" />
        </div>
        <div className="konten-artikel">
          <div className="judul-artikel">Judul Artikel</div>
          <p className="isi-artikel">Isi Artikel</p>
        </div>
      </div>
    );
  }
}

export default BlogPost;
